CREATE OR ALTER PROCEDURE [dbo].[Report_control_saldos_empleado]
@IDReportTask as INT
AS
SELECT sysrovwAllEmployeeGroups.EmployeeName, EmployeeContracts.EndDate, EmployeeContracts.IDContract, EmployeeContracts.BeginDate, Concepts.Name, TMPVSL_AnnualAccruals.HorasConvenio, TMPVSL_AnnualAccruals.HorasConvenioAoAnterior, TMPVSL_AnnualAccruals.ValorInicialHorasConvenioAoActual, TMPVSL_AnnualAccruals.HorasConvenioArrastradasAoAnterior, TMPVSL_AnnualAccruals.OldAntiquity, TMPVSL_AnnualAccruals.OldHolidays, TMPVSL_AnnualAccruals.Holidays, TMPVSL_AnnualAccruals.CurrentHolidays, TMPVSL_AnnualAccruals.Antiquity, TMPVSL_AnnualAccruals.HolidaysDays, TMPVSL_AnnualAccruals.idEmployee, TMPVSL_AnnualAccruals.Month_1, TMPVSL_AnnualAccruals.Month_2, TMPVSL_AnnualAccruals.Month_3, TMPVSL_AnnualAccruals.Month_4, TMPVSL_AnnualAccruals.Month_5, TMPVSL_AnnualAccruals.Month_6, TMPVSL_AnnualAccruals.Month_7, TMPVSL_AnnualAccruals.Month_8, TMPVSL_AnnualAccruals.Month_9, TMPVSL_AnnualAccruals.Month_10, TMPVSL_AnnualAccruals.Month_11, TMPVSL_AnnualAccruals.Month_12
 FROM   (dbo.sysrovwAllEmployeeGroups sysrovwAllEmployeeGroups 
 INNER JOIN (dbo.EmployeeContracts EmployeeContracts 
 INNER JOIN dbo.tmpVSL_AnnualAccruals TMPVSL_AnnualAccruals ON EmployeeContracts.IDContract=TMPVSL_AnnualAccruals.idContract) ON sysrovwAllEmployeeGroups.IDEmployee=TMPVSL_AnnualAccruals.idEmployee) INNER JOIN dbo.Concepts Concepts ON TMPVSL_AnnualAccruals.IDConcept=Concepts.ID
 where IdReportTask = @IDReportTask
 ORDER BY sysrovwAllEmployeeGroups.EmployeeName, EmployeeContracts.IDContract
GO